import {data} from "../../helper/data"
import Card from "./Card";
import "./Main.scss";

const Main = () => {
    console.log(data)
    return (
        <div className="card-container">
            {data.map((item)=> (<Card key={item.id} {...item} />)) }
        
        </div>
    );
};

export default Main;
